import React from 'react';
import { useState } from 'react';
import { Drawer, IconButton, List, ListItemButton, ListItemIcon, ListItemText } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';

const Drawercomp = ({ links, tabContents }) => {
  const [open, setOpen] = useState(false);

  return (
    <>
      <Drawer PaperProps={{ sx: { backgroundColor: 'rgba(49,49,116,1)' } }} open={open} onClose={() => setOpen(false)}>
        <List>
          {links.map((link, index) => (
            <ListItemButton onClick={() => setOpen(false)} key={index}>
              <ListItemIcon>
                <ListItemText sx={{ color: 'white' }}>
                  {tabContents[index]}
                </ListItemText>
              </ListItemIcon>
            </ListItemButton>
          ))}
        </List>
      </Drawer>

      <IconButton sx={{ marginLeft: 'auto', color: 'white' }} onClick={() => setOpen(!open)}>
        <MenuIcon />
      </IconButton>
    </>
  );
};

export default Drawercomp;
